import React from 'react';
import Common from './Common';
import web from './Images/1b.svg';

const Home =()=>{
    return(
        <>
            <Common name="Grow Up Your Business With" imgsrc={web} visit="/service" btnname="Get Started"/>
        </>
    );
};

export default Home;
